Text:
@_ClaireConnelly 📮 When I got it “mildly,” between July 23 to c. August 15, if felt like a never ending weird cold.

Did NOT follow the course my usual colds do.  Mild raw throat, nasal congestion, dry cough, little-to-no phlegm, but lasted for weeks!

And I have a raw throat today: Is it back?
